    private final static String test = "COM)B\nB)C\nC)D\nD)E\nE)F\nB)G\nG)H\nD)I\nE)J\nJ)K\nK)L\nK)YOU\nI)SAN";
    private final static Map<String, Set<String>> orbits = new HashMap<>();


    private static void getIndirect(String obj, Set<String> orbit) {
        Set<String> set = orbits.get(obj);
        if (set == null) {
            return;
        }
        for (String o : set) {
            orbit.add(o);
            getIndirect(o, orbit);
        }

    }


    // Taken from: https://stackoverflow.com/questions/8064570/what-is-the-best-way-get-the-symmetric-difference-between-two-sets-in-java
    private static <T> Set<T> diff(final Set<? extends T> s1, final Set<? extends T> s2) {
        Set<T> symmetricDiff = new HashSet<T>(s1);
        symmetricDiff.addAll(s2);
        Set<T> tmp = new HashSet<T>(s1);
        tmp.retainAll(s2);
        symmetricDiff.removeAll(tmp);
        return symmetricDiff;
    }

    public static void main(String[] args) {
        for (String s : input.split("\n")) {
            String[] split = s.split("\\)");
            Set<String> orbit = new HashSet<>();
            orbit.add(split[0]);
            orbits.put(split[1], orbit);
        }

        Set<String> indirectsYOU = new HashSet<>();
        Set<String> indirectsSAN = new HashSet<>();
        getIndirect("YOU", indirectsYOU);
        getIndirect("SAN", indirectsSAN);

        Set<String> diff = diff(indirectsSAN, indirectsYOU);

        System.out.println(diff.size());
    }

